import React from 'react'
import { useContext } from 'react'
import noteContext from '../context/notes/NoteContext'

const Home = () => {
  const data = useContext(noteContext)
  return (
    <div>{`this is home of ${data.state.name}`}</div>
  )
}

export default Home
